var $bm_rt;
var s, max, min, t1, t2;
s = effect('howFar')('Slider');
max = [
    s,
    s
];
min = [
    100,
    100
];
t1 = key(1).time;
$bm_rt = t2 = key(2).time;
if (time <= t1)
    $bm_rt = min;
else if (time > t1 && time < t2)
    $bm_rt = max;
else
    $bm_rt = max;

